import { createSwitchNavigator, createAppContainer } from "react-navigation";
import Register from "./register";
import Signup from "./linear";
import Info from "./addSkill";
import HomePage from "./main1";
import Settings from "./accountSettings";
import Linear from "./linear";
import Linear1 from "./linear1";
export default createAppContainer(
  createSwitchNavigator(
    { Signup, Register, Info, HomePage, Settings, Linear, Linear1 },
    {
      initialRouteName: "Linear1",
    }
  )
);
